pragma solidity ^0.4.2;

contract FundChain{

    struct PhilantropyAgent{
        string agentName;
        string agentDescription;
        string agentImage;
        string agentAddress;
    }

    struct NonProfitDistributor{
        //address beneficiary;
        string distributorName;
        string distributorImage;
        string distributorAddress;
    }

    struct GrassrootLevelUser{

        string userName;
        string userImage;
        string userAddress;
        uint fundsRecieved;
    }
    
    mapping(uint=>GrassrootLevelUser) public endUserSupplyChains;
    PhilantropyAgent public agent;
    NonProfitDistributor public distributor;
    uint NO_OF_USERS=6;
    uint public distributorFundRecievedCount ;
    uint public agentDonationCount;


    constructor() public {
       
        agent=PhilantropyAgent("Meghansh Goel","World-Renowned Techie","https://qph.fs.quoracdn.net/main-thumb-78977228-200-oetyqsamqxgdexqtachacuslunzegfym.jpeg","0xE11D4E166069B474E1567F1A8c21db26bB9BCd74");
        distributor=NonProfitDistributor("Umeed","http://cdn.morganfoundation.org.nz/wp-content/uploads/2017/01/climate-hope-846x771.jpg","0xc31a645997a9617f96667EaE0561A340bC95e7B9");
        endUserSupplyChains[0]=GrassrootLevelUser("Food","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS6bfUMZgA3kFBrZSnV6Csz-wD4cHERQTzWcYDRPAgvkpu0ZpTU","0x287CFb49ceBac74dd0b28Fa8dE3a4D0ecC8d3a7c",0);
        endUserSupplyChains[1]=GrassrootLevelUser("Water","http://ichef.bbci.co.uk/wwfeatures/wm/live/1280_640/images/live/p0/65/bv/p065bvw8.jpg","0x31f9Aae8434Bb4A09d969871CDd59A5B12E90d5f",0);
        endUserSupplyChains[2]=GrassrootLevelUser("Sanitation","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRkEYtkEVz5CAYByWbsfoW-TsS72Q1xnWL_Axe8O3ysYWGpqno3","0xE61582efb7DaD1b68494173b509b38F0BEaF2D82",0);
        endUserSupplyChains[3]=GrassrootLevelUser("Medicine","https://www.btvi.in/media/images/news/05249cffbafe7bd6bb13c94807815580.jpeg","0x56C10FC821263340f0DfAaD42BE565F34e85F537",0);
        endUserSupplyChains[4]=GrassrootLevelUser("Others","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQqPdEDDj6-Vu7jBUJ_Oo03VKFzMZ0CSTyfRlI8G_JJ-q0v8yg_","0x228cF6d0b52F83d0DD591bE387df1b16d6cFA2c5",0);
    }

    event updateDonationCompleteUI(uint agentDonationCount);

    function updateDistributorFund(uint _fund) public{
        agentDonationCount=agentDonationCount+_fund;
        distributorFundRecievedCount=distributorFundRecievedCount+_fund;
        emit updateDonationCompleteUI(agentDonationCount);
    }
    


    function distributeFunds(uint _index,uint _recievedfund) public{
        endUserSupplyChains[_index].fundsRecieved+=_recievedfund;
           
    }    

}
